import React from 'react';
import './navbar.css';

function Navbar2() {
  return (
    <div className="navbar2">
      <ul className='navbar-menu2'>
        <li>Products</li>
        <li>Solutions</li>
        <li>Customers</li>
        <li>Resources</li>
        <li>Contact us</li>
        <li>Get started</li>
      </ul>
    </div>
  );
}

export default Navbar2;
